    match effs with
    | [] -> PStr []
    | [eff] -> PStr[Str.eval (effect_expr eff)]
    | effs -> PStr[Str.eval (Exp.tuple (List.map effect_expr effs))]
  in
  Attr.mk ~loc:Location.none effects_loc payload

